using UnityEngine;
using System.Collections;

public class Point : MonoBehaviour
{

    public float speed;


	void Start () 
    {
	    Destroy(gameObject, 5.4f);
	}
	
	void Update () 
    {
	    transform.Translate(new Vector3(0, speed * Time.deltaTime, 0));
	    speed -= 0.01f;
    }
}
